import { useNavigate } from "react-router-dom";
import { TextField, Button, Box } from "@mui/material";
import IconButton from '@mui/material/IconButton';
import Input from '@mui/material/Input';
import FilledInput from '@mui/material/FilledInput';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import InputAdornment from '@mui/material/InputAdornment';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import * as React from 'react';
import { useFormik } from 'formik';
import * as yup from 'yup';
import { Formik, Field, Form, ErrorMessage } from 'formik';

interface State {
    email: string;
    password: string;
    passwordConfirmation: string;
    showPassword: boolean;
    formIsValid: boolean;
    emailIsValid: boolean;
}


 export const validPassword = new RegExp('^(?=.*?[A-Z])(?=.*?[0-9]).{7,}$');

const Register: React.FC = () => {
    let navigate = useNavigate();

    const validationSchema = yup.object({
        email: yup
             .string()
             .email('Entrer un email valide')
             .required('Email obligatoire'),    
        password: yup
            .string()
            .length(7, "Le mot de passe doit contenir au moins 7 charactÃ©re")
            .matches(validPassword, "Le mot de passe doit contenir au moins une majuscule et 1 chiffre")
            .required("Mot de passe obligatoire"),
        passwordConfirmation: yup
            .string()
            .oneOf([yup.ref('password'), null], "Les mots de passe ne correspondent pas")
            .required("La validation de mot de passe et obligatoire")
       });

    const [values, setValues] = React.useState<State>({
        email: '',
        password: '',
        passwordConfirmation: '',
        showPassword: false,
        formIsValid: false,
        emailIsValid: false,
      });

      const formik = useFormik({
        initialValues: {
          email: '',
          password: '',
          passwordConfirmation: ''
        },
        validationSchema: validationSchema ,    
        onSubmit: values => {  
            console.log(values);
        },
    });

      const handleChange =
        (prop: keyof State) => (event: React.ChangeEvent<HTMLInputElement>) => {
          setValues({ ...values, [prop]: event.target.value });
        };

      const handleClickShowPassword = () => {
        setValues({
          ...values,
          showPassword: !values.showPassword,
        });
      };

      const handleMouseDownPassword = (event: React.MouseEvent<HTMLButtonElement>) => {
        event.preventDefault();
      };

    return (
<Box sx={{ display: 'flex', flexWrap: 'wrap', paddingBottom: 200, flexDirection: "column", alignContent: "center", paddingTop: 10 }}>

        {/* <Formik
            initialValues={formik.initialValues}
            validationSchema={validationSchema}
            onSubmit={() => {console.log("test")}}
        > */}
        {/* <form onSubmit={formik.handleSubmit}> */}
        <FormControl sx={{ m: 1, width: '25ch' }} variant="filled">
          <InputLabel htmlFor="filled-adornment-email">Email</InputLabel>
          <FilledInput
            required
            id="email"
            type="email"
            name="email"
            value={formik.values.email}
            onChange={formik.handleChange}
            endAdornment={<InputAdornment position="end">@</InputAdornment>}
            error={formik.touched.email && Boolean(formik.errors.email)}
            aria-describedby="filled-weight-helper-text"
            inputProps={{
              'aria-label': 'email',
            }}
          />
        </FormControl>
        <FormControl sx={{ m: 1, width: '25ch' }} variant="filled">
          <InputLabel htmlFor="filled-adornment-password">Password</InputLabel>
          <FilledInput
            required
            id="filled-adornment-password"
            name="password"
            type={values.showPassword ? 'text' : 'password'}
            value={formik.values.password}
            onChange={formik.handleChange}
            error={formik.touched.password && Boolean(formik.errors.password)}
            endAdornment={
              <InputAdornment position="end">
                <IconButton
                  aria-label="toggle password visibility"
                  onClick={handleClickShowPassword}
                  onMouseDown={handleMouseDownPassword}
                  edge="end"
                >
                  {values.showPassword ? <VisibilityOff /> : <Visibility />}
                </IconButton>
              </InputAdornment>
            }
          />
        </FormControl>
        <FormControl sx={{ m: 1, width: '25ch', paddingBottom: 5 }} variant="filled">
          <InputLabel htmlFor="filled-adornment-passwordConfirmation">Password Confirmation</InputLabel>
          <FilledInput
            required
            id="filled-adornment-passwordConfirmation"
            name="passwordConfirmation"
            type={values.showPassword ? 'text' : 'password'}
            value={formik.values.passwordConfirmation}
            onChange={formik.handleChange('passwordConfirmation')}
            error={formik.touched.passwordConfirmation && Boolean(formik.errors.passwordConfirmation)}
            endAdornment={
              <InputAdornment position="end">
                <IconButton
                  aria-label="toggle password confirmation visibility"
                  onClick={handleClickShowPassword}
                  onMouseDown={handleMouseDownPassword}
                  edge="end"
                >
                  {values.showPassword ? <VisibilityOff /> : <Visibility />}
                </IconButton>
              </InputAdornment>
            }
          />
        </FormControl>
        {/* </Formik> */}
        <Button onClick={() => {
            //   console.log(values.email + " et " + values.password);
              //formik.handleSubmit();
              //navigate("/register");
            }} 
              variant="outlined"
              disabled={!values.formIsValid}
              type="submit"
              > 
              S'enregistrer
          </Button>
          <Button onClick={() => {
              console.log(values.email + " et " + values.password);
              navigate("/test");
            }} 
              sx={{marginTop: 3}}
              variant="outlined"
              > 
              Se connecter
          </Button>
          {/* </form> */}
    </Box>
    );
};

export default Register;
